 "<p>Teachers should keep the following in mind when using this iDevice: <\/p><ol><li>Think about the number of different types of activity planned for your resource that will be visually signalled in the content. Avoid using too many different types or classification of activities otherwise learner may become confused. Usually three or four different types are more than adequate for a teaching resource.<\/li><li>From a visual design perspective, avoid having two iDevices immediately following each other without any text in between. If this is required, rather collapse two questions or events into one iDevice. <\/li><li>Think about activities where the perceived benefit of doing the activity outweighs the time and effort it will take to complete the activity. <\/li><\/ol>": "<p>Os docentes deben recordar o seguinte cando estean a utilizar este iDevice: <\/p><ol><li>Pense na cantidade de diferentes tipos de actividades planificadas como recurso que ser\u00e1n sinaladas visualmente como contido. Tente non utilizar moitos tipos diferentes de clasificaci\u00f3ns de actividades para non confundir ao alumnado. Normalmente tres ou catro tipos diferentes son m\u00e1is que suficientes para un recurso de ensinanza.<\/li><li>Dende unhas perspectiva de dese\u00f1o visual, tenta non po\u00f1er os iDevices xuntos sen texto no medio. Si pensa que \u00e9 necesario, una d\u00faas preguntas e eventos dun IDevice. <\/li><li>Pense actividades nas que o beneficio de completar a actividade supere ao custe en tempo e esforzo de completala. <\/li><\/ol>", 
