 "Insert Column After": "Insertar columna (desp\u00f3is)", 
 "<dl>  <dt>If your goal is to test understanding of core concepts or reading comprehension  <\/dt>  <dd>    <p>  Write a summary of the concept or reading long  enough to adequately test the target's knowledge, but short enough not to induce fatigue. Less than one typed page is probably adequate, but probably considerably less for young students or beginners.    <\/p>    <p>Choose words in the text thatare key to understanding the concepts. Thesewill probably be verbs, nouns, and key adverbs.Choose alternatives with one clear answer.    <\/p>  <\/dd>  <dt>If your goal is to test vocabulary knowledge  <\/dt>  <dt>If your goal is to test word formation\/grammar:  <\/dt>  <dd>  <p>Write a text using the target forms. This text should be coherent and cohesive, and be of an appropriate length. Remember that the goal is not vocabulary knowledge, so the core meanings of the stem words should be well known to the students.  <\/p>  <p>Highlight the target words in the text. Provide alternatives with the same word stem, but different affixes. It is a good idea to get a colleague to test the test\/exercise to make sure there are no surprises!  <\/p>  <\/dd><\/dl>": "<dl>  <dt>Si o seu obxectivo \u00e9 avaliar a comprensi\u00f3n lectora dos conceptos clave dun curso, ou a comprensi\u00f3n lectora<\/dt>  <dd>    <p> Escriba un resumo do concepto de lectura o suficientemente longo como para que aval\u00ede adecuadamente o co\u00f1ecemento do obxectivo, pero o suficientemente curso como para que non produza fatiga. Probablemente unha p\u00e1xina impresa sexa un tama\u00f1o adecuado, pero considere a posibilidade de utilizar un texto menor para nenos ou principiantes.    <\/p>    <p>Seleccione palabras do texto que sexan claves para c omprensi\u00f3n dos concpetos. Estas ser\u00e1n probablemente verbos, sustantivos e adverbios clave. Elixa alternativas con unha resposta clara.    <\/p>  <\/dd>  <dt>Si o seu obxectivo \u00e9 avaliar o co\u00f1ecemento de vocabulario  <\/dt>  <dt>Si o seu obxectivo \u00e9 avaliar a morfolox\u00eda e a gram\u00e1tica:  <\/dt>  <dd>  <p>Escriba un texto onde se utilicen estas formas. Este texto debe ser coherente e ter sentido completo, ademais de ter unha lonxitude adecuada. Recorda que o obxectivo non \u00e9 o vocabulario, e polo tanto o significado b\u00e1sico das ra\u00edces deben ser ben co\u00f1ecidos polos estudantes.  <\/p>Resalta as palabras clave no texto. Propo\u00f1a alternativas coa mesma ra\u00edz pero con diferentes sufixos. \u00c9 unha boa idea conseguir que un amigo probe os exercicios para asegurarse que non haxa sorpresas!  <\/p>  <\/dd><\/dl>", 
