 "<p>Cloze exercises are texts or sentences where students must fill in missing words. They are often used for the following purposes:<\/p><ol><li>To check knowledge of core course concepts (this could be a pre-check, formative exercise, or summative check).<\/li><li>To check reading comprehension.<\/li><li>To check vocabulary knowledge.<\/li><li>To check word formation and\/or grammatical competence. <\/li><\/ol>": "<p>Os exercizos de encher ocos consisten en textos ou oraci\u00f3ns onde os estudantes deben completar as palabras que faltan. Util\u00edzanse normalmente coas seguintes finalidades:<\/p><ol><li>Para verificar o co\u00f1ecemento dos conceptos chave dun curso (poder\u00eda ser un test de preco\u00f1ecemento, un exercicio formativo ou unha verificaci\u00f3n sumativa).<\/li><li>Para verificar a comprensi\u00f3n lectora.<\/li><li>Para verificar os co\u00f1ecementos de vocabulario.<\/li><li>Para verificar a formaci\u00f3n de palabras ou a competencia gramatical. <\/li><\/ol>", 
